void main() {
  String s =
      "";
  String t =
      "";
  String? res = findTheDifference(s, t);
  print(res);
}

String? findTheDifference(String s, String t) {
  int a = 0;
  int b = 0;
  if (s.length == 0) {
    return t;
  }
  for (int i = 0; i < t.length; i++) {
    if (i < s.length) {
      a += s[i].codeUnits.first;
    }
    b += t[i].codeUnits.first;
  }
  return String.fromCharCode(b - a);
}
